import React from 'react'
import { Switch, Route } from 'react-router-dom'
//import Listmahasiswa from './content/company/Listcompany';
//import Listjurusan from './content/company/Listcompany';
//import Test from './content/company/Test';
import home from './content/Home'
import { Redirect } from 'react-router';
import apiconfig from '../configs/api.config.json'

const DashboardSwitcher = () => {

    return (

        <main role="main" class="col-md-9 ml-sm-auto col-lg-10 pt-3 px-4">
            <Switch>
            <Route path="/home" component={home} />
            {/*<Route path="/jurusan" component={Listjurusan} />  */}
            </Switch>
        </main>
    )
}

const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route
      {...rest}
      render={props =>
        localStorage.getItem(apiconfig.LS.TOKEN)!=null? (
          <Component {...props} />
        ) : (
          <Redirect
            to={{
              pathname: "/",
              state: { from: props.location }
            }}
          />
        )
      }
    />
  );
export default DashboardSwitcher
